function o(){this.result=0}o.prototype.add=function(t){return this.result+=t,this};o.prototype.multiply=function(t){return this.result*=t,this};o.prototype.getResult=function(){return this.result};var r=new o,l=r.add(5).multiply(2).getResult();console.log("计算结果:",l);l>10?console.log("结果大于10"):console.log("结果小于等于10");for(var e=0;e<3;e++)console.log("循环:",e);try{throw new Error("测试错误")}catch(t){console.log("捕获错误:",t.message)}
